import React from 'react';
import {Input, Table,InputGroup,InputGroupAddon} from 'reactstrap';
import Translate from "../../../../../../Translate";
import {Settings} from "react-feather";
import DropdownComponent from "../../../../../../components/dropdown/dropdown";

export default class Example extends React.Component {
    render() {
        return (
            <Table borderless>
                <thead>
                <tr>
                    <th><Translate name={"barcode"}/></th>
                    <th><Settings></Settings></th>
                </tr>
                </thead>
                <tbody>
                <tr>
                    <td>Mark</td>
                    <td>@mdo</td>
                </tr>
                <tr>
                    <td>Jacob</td>
                    <td>@fat</td>
                </tr>
                <tr>
                    <td>
                        <div className="input-group">
                            <InputGroup size="sm" >
                                <Input
                                    type="text"
                                    id="barcode"
                                    sm="3"
                                    value={this.props.product.barcode ? this.props.product.barcode || '' : ''}
                                    onChange={event => this.props.setModalValues("barcode", event.target.value)}
                                />
                                <InputGroupAddon addonType="prepend"  sm="3">
                                    <DropdownComponent
                                        data={this.props.barcodeTypes}
                                        onChange={this.props.setModalValues}
                                        name='barcodeType'
                                    />
                                </InputGroupAddon>
                            </InputGroup>

                        </div>
                    </td>
                    <td>@twitter</td>
                </tr>
                </tbody>

            </Table>
        );
    }
}
